function Menu() {
  return (
    <>
      <div
        style={{
          float: 'left',
          border: '1px solid black',
          borderRight: '1px solid black',
          height: '300px',
          paddingRight: '20px',
        }}>
        Menu
      </div>
    </>
  );
}

export default Menu;
